import React from 'react';
import LiveCricketScorecard from './components/cricket/LiveCricketScorecard';
import './App.css';

function App() {
  return (
    <div className="App min-h-screen bg-gradient-to-br from-slate-900 via-blue-900 to-slate-900">
      <div className="rotating-background" />
      <div className="content-layer relative z-10">
        <LiveCricketScorecard />
      </div>
    </div>
  );
}

export default App;
